var documenterSearchIndex = {"docs":
[{"location":"","page":"StableTrees","title":"StableTrees","text":"<style>\n    table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    pre, div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"1f7c0ca8b61b2f4fa6e9e9f60b6a71e3a7d4dd8b9ff5ad3ef56a629ae668d5ae\"\n    julia_version = \"1.7.3\"\n-->\n\n\n\n\n<script>const getParentCell = el => el.closest(\"pluto-cell\")\n\nconst getHeaders = () => {\n\tconst depth = Math.max(1, Math.min(6, 3)) // should be in range 1:6\n\tconst range = Array.from({length: depth}, (x, i) => i+1) // [1, ..., depth]\n\t\n\tconst selector = range.map(i => `pluto-notebook pluto-cell h${i}`).join(\",\")\n\treturn Array.from(document.querySelectorAll(selector))\n}\n\nconst indent = true\nconst aside = true\n\nconst clickHandler = (event) => {\n\tconst path = (event.path || event.composedPath())\n\tconst toc = path.find(elem => elem?.classList?.contains?.(\"toc-toggle\"))\n\tif (toc) {\n\t\tevent.stopImmediatePropagation()\n\t\ttoc.closest(\".plutoui-toc\").classList.toggle(\"hide\")\n\t}\n}\n\ndocument.addEventListener(\"click\", clickHandler)\n\n\nconst render = (el) => html`${el.map(h => {\n\tconst parent_cell = getParentCell(h)\n\n\tconst a = html`<a \n\t\tclass=\"${h.nodeName}\" \n\t\thref=\"#${parent_cell.id}\"\n\t>${h.innerText}</a>`\n\t/* a.onmouseover=()=>{\n\t\tparent_cell.firstElementChild.classList.add(\n\t\t\t'highlight-pluto-cell-shoulder'\n\t\t)\n\t}\n\ta.onmouseout=() => {\n\t\tparent_cell.firstElementChild.classList.remove(\n\t\t\t'highlight-pluto-cell-shoulder'\n\t\t)\n\t} */\n\ta.onclick=(e) => {\n\t\te.preventDefault();\n\t\th.scrollIntoView({\n\t\t\tbehavior: 'smooth', \n\t\t\tblock: 'start'\n\t\t})\n\t}\n\n\treturn html`<div class=\"toc-row\">${a}</div>`\n})}`\n\nconst tocNode = html`<nav class=\"plutoui-toc\">\n\t<header>\n     <span class=\"toc-toggle open-toc\">ðŸ“–</span>\n     <span class=\"toc-toggle closed-toc\">ðŸ“•</span>\n\tTable of Contents</header>\n\t<section></section>\n</nav>`\n\ntocNode.classList.toggle(\"aside\", aside)\ntocNode.classList.toggle(\"indent\", indent)\n\nconst updateCallback = () => {\n\ttocNode.querySelector(\"section\").replaceWith(\n\t\thtml`<section>${render(getHeaders())}</section>`\n\t)\n}\nupdateCallback()\nsetTimeout(updateCallback, 100)\nsetTimeout(updateCallback, 1000)\nsetTimeout(updateCallback, 5000)\n\nconst notebook = document.querySelector(\"pluto-notebook\")\n\n\n// We have a mutationobserver for each cell:\nconst observers = {\n\tcurrent: [],\n}\n\nconst createCellObservers = () => {\n\tobservers.current.forEach((o) => o.disconnect())\n\tobservers.current = Array.from(notebook.querySelectorAll(\"pluto-cell\")).map(el => {\n\t\tconst o = new MutationObserver(updateCallback)\n\t\to.observe(el, {attributeFilter: [\"class\"]})\n\t\treturn o\n\t})\n}\ncreateCellObservers()\n\n// And one for the notebook's child list, which updates our cell observers:\nconst notebookObserver = new MutationObserver(() => {\n\tupdateCallback()\n\tcreateCellObservers()\n})\nnotebookObserver.observe(notebook, {childList: true})\n\n// And finally, an observer for the document.body classList, to make sure that the toc also works when if is loaded during notebook initialization\nconst bodyClassObserver = new MutationObserver(updateCallback)\nbodyClassObserver.observe(document.body, {attributeFilter: [\"class\"]})\n\n// Hide/show the ToC when the screen gets small\nlet m = matchMedia(\"(max-width: 1000px)\")\nlet match_listener = () => \n\ttocNode.classList.toggle(\"hide\", m.matches)\nmatch_listener()\nm.addListener(match_listener)\n\ninvalidation.then(() => {\n\tnotebookObserver.disconnect()\n\tbodyClassObserver.disconnect()\n\tobservers.current.forEach((o) => o.disconnect())\n\tdocument.removeEventListener(\"click\", clickHandler)\n\tm.removeListener(match_listener)\n})\n\nreturn tocNode\n</script><style>@media not print {\n\n.plutoui-toc {\n\t--main-bg-color: unset;\n\t--pluto-output-color: hsl(0, 0%, 36%);\n\t--pluto-output-h-color: hsl(0, 0%, 21%);\n}\n\n@media (prefers-color-scheme: dark) {\n\t.plutoui-toc {\n\t\t--main-bg-color: hsl(0deg 0% 21%);\n\t\t--pluto-output-color: hsl(0, 0%, 90%);\n\t\t--pluto-output-h-color: hsl(0, 0%, 97%);\n\t}\n}\n\n.plutoui-toc.aside {\n\tcolor: var(--pluto-output-color);\n\tposition:fixed;\n\tright: 1rem;\n\ttop: 5rem;\n\twidth: min(80vw, 300px);\n\tpadding: 10px;\n\tborder: 3px solid rgba(0, 0, 0, 0.15);\n\tborder-radius: 10px;\n\tbox-shadow: 0 0 11px 0px #00000010;\n\t/* That is, viewport minus top minus Live Docs */\n\tmax-height: calc(100vh - 5rem - 56px);\n\toverflow: auto;\n\tz-index: 40;\n\tbackground-color: var(--main-bg-color);\n\ttransition: transform 300ms cubic-bezier(0.18, 0.89, 0.45, 1.12);\n}\n\n.plutoui-toc.aside.hide {\n\ttransform: translateX(calc(100% - 28px));\n}\n.plutoui-toc.aside.hide section {\n\tdisplay: none;\n}\n.plutoui-toc.aside.hide header {\n\tmargin-bottom: 0em;\n\tpadding-bottom: 0em;\n\tborder-bottom: none;\n}\n}  /* End of Media print query */\n.plutoui-toc.aside.hide .open-toc,\n.plutoui-toc.aside:not(.hide) .closed-toc,\n.plutoui-toc:not(.aside) .closed-toc {\n\tdisplay: none;\n}\n\n@media (prefers-reduced-motion) {\n  .plutoui-toc.aside {\n    transition-duration: 0s;\n  }\n}\n\n.toc-toggle {\n\tcursor: pointer;\n\tpadding: 1em;\n\tmargin: -1em;\n    margin-right: -0.7em;\n}\n\n.plutoui-toc header {\n\tdisplay: block;\n\tfont-size: 1.5em;\n\tmargin-top: -0.1em;\n\tmargin-bottom: 0.4em;\n\tpadding-bottom: 0.4em;\n\tmargin-left: 0;\n\tmargin-right: 0;\n\tfont-weight: bold;\n\tborder-bottom: 2px solid rgba(0, 0, 0, 0.15);\n}\n\n.plutoui-toc section .toc-row {\n\twhite-space: nowrap;\n\toverflow: hidden;\n\ttext-overflow: ellipsis;\n\tpadding-bottom: 2px;\n}\n\n.highlight-pluto-cell-shoulder {\n\tbackground: rgba(0, 0, 0, 0.05);\n\tbackground-clip: padding-box;\n}\n\n.plutoui-toc section a {\n\ttext-decoration: none;\n\tfont-weight: normal;\n\tcolor: var(--pluto-output-color);\n}\n.plutoui-toc section a:hover {\n\tcolor: var(--pluto-output-h-color);\n}\n\n.plutoui-toc.indent section a.H1 {\n\tfont-weight: 700;\n\tline-height: 1em;\n}\n\n.plutoui-toc.indent section a.H1 {\n\tpadding-left: 0px;\n}\n.plutoui-toc.indent section a.H2 {\n\tpadding-left: 10px;\n}\n.plutoui-toc.indent section a.H3 {\n\tpadding-left: 20px;\n}\n.plutoui-toc.indent section a.H4 {\n\tpadding-left: 30px;\n}\n.plutoui-toc.indent section a.H5 {\n\tpadding-left: 40px;\n}\n.plutoui-toc.indent section a.H6 {\n\tpadding-left: 50px;\n}\n</style>\n\n\n<div class=\"markdown\"><p>This package is a pure Julia implementation of the <strong>S</strong>table and <strong>I</strong>nterpretable <strong>RU</strong>le <strong>S</strong>ets &#40;SIRUS&#41; algorithm. This package has only implemented binary classification for now. Regression and multiclass-classification will be implemented later. For R users, the SIRUS package is also available via <a href=\"https://cran.r-project.org/web/packages/sirus/index.html\">CRAN</a>.</p>\n<p>The algorithm is based on random forests. However, compared to random forests, the model is much more interpretable since the forests are converted to a set of decison rules. This page will provide an overview of the algorithm and describe not only how it can be used but also how it works. To do this, let&#39;s start by briefly describing random forests.</p>\n</div>\n\n","category":"page"},{"location":"#Random-forests","page":"StableTrees","title":"Random forests","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Random forests are known to produce accurate predictions especially in settings where the number of features <code>p</code> is close to or higher than the number of observations <code>n</code> &#40;Biau &amp; Scornet, <a href=\"https://doi.org/10.1007/s11749-016-0481-7\">2016</a>&#41;. Let&#39;s start by explaining the building blocks of random forests: decision trees. As an example, we take Haberman&#39;s Survival Data Set &#40;see the Appendix below for more details&#41;:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>data = _haberman()</code></pre>\n<table>\n<tr>\n<th></th>\n<th>age</th>\n<th>year</th>\n<th>nodes</th>\n<th>survival</th>\n</tr>\n<tr>\n<td>1</td>\n<td>30.0</td>\n<td>1964.0</td>\n<td>1.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>2</td>\n<td>30.0</td>\n<td>1962.0</td>\n<td>3.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>3</td>\n<td>30.0</td>\n<td>1965.0</td>\n<td>0.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>4</td>\n<td>31.0</td>\n<td>1959.0</td>\n<td>2.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>5</td>\n<td>31.0</td>\n<td>1965.0</td>\n<td>4.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>6</td>\n<td>33.0</td>\n<td>1958.0</td>\n<td>10.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>7</td>\n<td>33.0</td>\n<td>1960.0</td>\n<td>0.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>8</td>\n<td>34.0</td>\n<td>1959.0</td>\n<td>0.0</td>\n<td>0</td>\n</tr>\n<tr>\n<td>9</td>\n<td>34.0</td>\n<td>1966.0</td>\n<td>9.0</td>\n<td>0</td>\n</tr>\n<tr>\n<td>10</td>\n<td>34.0</td>\n<td>1958.0</td>\n<td>30.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>...</td>\n</tr>\n<tr>\n<td>306</td>\n<td>83.0</td>\n<td>1958.0</td>\n<td>2.0</td>\n<td>0</td>\n</tr>\n</table>\n\n\n<pre class='language-julia'><code class='language-julia'>X = data[:, Not(:survival)];</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>y = data.survival;</code></pre>\n\n\n\n<div class=\"markdown\"><p>This dataset contains observations from a study with patients who had breast cancer. The <code>survival</code> column contains a <code>0</code> if a patient has died within 5 years and <code>1</code> if the patient has survived for at least 5 years. The aim is to predict survival based on the <code>age</code>, the <code>year</code> in which the operation was conducted and the number of detected auxillary <code>nodes</code>.</p>\n</div>\n\n\n<div class=\"markdown\"><p>Via <a href=\"https://github.com/alan-turing-institute/MLJ.jl\"><code>MLJ.jl</code></a>, we can fit multiple decision trees on this dataset:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>tree_evaluations = let\n    model = DecisionTreeClassifier(; max_depth=2, rng=_rng())\n    _evaluate(model, X, y)\nend;</code></pre>\n\n\n\n<div class=\"markdown\"><p>This has fitted various trees to various subsets of the dataset via cross-validation. Here, I&#39;ve set <code>max_depth&#61;2</code> to simplify the fitted trees which makes the tree more easily explainable. Also, for our small dataset, this forces the model to remain simple so it likely reduces overfitting. Let&#39;s look at the first tree:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    tree = tree_evaluations.fitted_params_per_fold[1].tree\n    _io2text() do io\n        DecisionTree.print_tree(io, tree; feature_names=names(data))\n    end\nend</code></pre>\n<pre id='var-hash904630' class='code-output documenter-example-output'>Feature 3: \"nodes\" < 2.5 ?\nâ”œâ”€ Feature 1: \"age\" < 79.5 ?\n    â”œâ”€ 2 : 151/178\n    â””â”€ 1 : 1/1\nâ””â”€ Feature 1: \"age\" < 43.5 ?\n    â”œâ”€ 2 : 16/20\n    â””â”€ 1 : 42/76\n</pre>\n\n\n<div class=\"markdown\"><p>What this shows is that the first tree decided that the <code>nodes</code> feature is the most helpful in deciding who will survive for 5 more years. Next, if the <code>nodes</code> feature is below 2.5, then <code>age</code> will be selected on. If <code>age &lt; 79.5</code>, then the model will predict the second class and if <code>age â‰¥ 79.5</code> it will predict the first class. Similarly for <code>age &lt; 43.5</code>. Now, let&#39;s see what happens for a slight change in the data. In other words, let&#39;s see how the fitted model for the second split looks:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    tree = tree_evaluations.fitted_params_per_fold[2].tree\n    _io2text() do io\n        DecisionTree.print_tree(io, tree; feature_names=names(data))\n    end\nend</code></pre>\n<pre id='var-hash126251' class='code-output documenter-example-output'>Feature 3: \"nodes\" < 2.5 ?\nâ”œâ”€ Feature 1: \"age\" < 77.0 ?\n    â”œâ”€ 2 : 147/175\n    â””â”€ 1 : 2/2\nâ””â”€ Feature 1: \"age\" < 43.5 ?\n    â”œâ”€ 2 : 18/21\n    â””â”€ 1 : 41/77\n</pre>\n\n\n<div class=\"markdown\"><p>This shows that the features and the values for the splitpoints are not the same for both trees. This is called stability. Or in this case, a decision tree is considered to be unstable. This instability is problematic in situations where real-world decisions are based on the outcome of the model. Imagine using this model for the selecting which students are allowed to enter some university. If the model is updated every year with the data from the last year, then the selection criteria would vary wildly per year. This instability also causes accuracy to fluctuate wildly. Intuitively, this makes sense: if the model changes wildly for small data changes, then model accuracy also changes wildly. This intuitively also implies that the model is more likely to overfit. This is why random forests were introduced. Basically, random forests fit a large number of trees and average their predictions to come to a more accurate prediction. The individual trees are obtained by restricting the observations and the features that the trees are allowed to use. For the restriction on the observations, the trees are only allowed to see <code>partial_sampling * n</code> observations. In practise, <code>partial_sampling</code> is often 0.7. The restriction on the features is defined in such a way that it guarantees that not every tree will take the same split at the root of the tree. This makes the trees less correlated &#40;James et al., <a href=\"https://doi.org/10.1007/978-1-0716-1418-1; Section 8.2.2\">2021</a>&#41; and, hence, very accurate.</p>\n<p>Unfortunately, these random forests are hard to interpret. To interpret the model, individuals would need to interpret hundreds to thousands of trees containing multiple levels. Alternatively, methods have been created to visualize these uninterpretable models &#40;for example, see Molnar &#40;<a href=\"https://christophm.github.io/interpretable-ml-book/\">2022</a>&#41;; Chapters 6, 7 and 8&#41;. The most promising one of these methods are Shapley values and SHAP. These methods show which features have the highest influence on the prediction. See my blog post on <a href=\"https://huijzer.xyz/posts/shapley/\">Random forests and Shapley values</a> for more information. Knowing which features have the highest influence is nice, but they do not state exactly what feature is used and at what cutoff. Again, this is not good enough for selecting students into universities. For example, what if the government decides to ask for details about the selection? The only answer that you can give is that some features are used for selection more than others and that they are on average used in a certain direction. If the government asks for biases in the model, then these are impossible to report. In practice, the decision is still a black-box. SIRUS solves this by extracting easily interpretable rules from the random forests.</p>\n</div>\n\n","category":"page"},{"location":"#Rule-based-models","page":"StableTrees","title":"Rule-based models","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Rule-based models promise much greater interpretability than random forests. Instead of returning a large number of trees, rule-based models return a set of rules. Each rule can be interpreted on its own and the final model aggregates these rules by summing the prediction of each rules. For example, one rule can be:</p>\n<blockquote>\n<p>if <code>nodes &lt; 4.5</code> then chance of survival is 0.6 and if <code>nodes â‰¥ 4.5</code> then chance of survival is 0.4.</p>\n</blockquote>\n<p>Note that these rules can be extracted quite easily from the decision trees. For splits on the second level of the tree, the rule could look like:</p>\n<blockquote>\n<p>if <code>nodes &lt; 4.5</code> and <code>age &lt; 38.5</code> then chance of survival is 0.8 and otherwise the chance of survival is 0.4.</p>\n</blockquote>\n<p>When applying this extracting of rules to a random forest, there will be thousands of rules. Next, via some heuristic, the most important rules can be localized and these rules then result in the final model. See, for example, RuleFit &#40;Friedman &amp; Popescu, <a href=\"https://www.jstor.org/stable/30245114\">2008</a>&#41;. The problem with this approach is that they are fitted on the unstable decision trees that were shown above. As an example, on time the tree splits on <code>age &lt; 43.5</code> and another time on <code>age &lt; 44.5</code>.</p>\n</div>\n\n","category":"page"},{"location":"#Tree-stabilization","page":"StableTrees","title":"Tree stabilization","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>In the papers which introduce SIRUS, BÃ©nard et al. &#40;<a href=\"https://doi.org/10.1214/20-EJS1792\">2021a</a>, <a href=\"https://proceedings.mlr.press/v130/benard21a.html\">2021b</a>&#41; proof that their algorithm is stable and that the other algorithms are not. They achieve their stability by restricting the location at which the splitpoints can be chosen. To see how this works, let&#39;s look at the <code>age</code> feature on its own.</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>nodes = sort(data.age);</code></pre>\n\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>The default random forest algorithm is allowed to choose any location inside this feature to split on. To avoid having to figure out locations by itself, the algorithm will choose on of the datapoints as a split location. So, for example, the following split indicated by the red vertical line would be a valid choice:</p>\n</div>\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>But what happens if we take a random subset of the data? Say, we take the following subset of length <code>0.7 * length&#40;nodes&#41;</code>:</p>\n</div>\n\n\n\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>Now, the algorithm would choose a different location and, hence, introduce instability. To solve this, BÃ©nard et al. decided to limit the splitpoints that the algorithm can use to split to data to a pre-defined set of points. For each feature, they find <code>q</code> empirical quantiles where <code>q</code> is typically 10. Let&#39;s overlay these quantiles on top of the <code>age</code> feature:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>Next, let&#39;s see where the cutpoints are when we take the same random subset as above:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>As can be seen, many cutpoints are at the same location as before. Furthermore, compared to the unrestricted range, the chance that two different trees who see a different random subset of the data will select the same cutpoint has increased dramatically.</p>\n<p>The benefit of this is that it is now quite easy to extract the most important rules. Rule extraction consists of simplifying them a bit and ordering them by frequency of occurrence. Let&#39;s see how accurate this model is.</p>\n</div>\n\n","category":"page"},{"location":"#Benchmarks","page":"StableTrees","title":"Benchmarks","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Let&#39;s compare the following models:</p>\n<ul>\n<li><p>Decision tree &#40;<code>DecisionTreeClassifier</code>&#41;</p>\n</li>\n<li><p>Stabilized random forest &#40;<code>StableForestClassifier</code>&#41;</p>\n</li>\n<li><p>SIRUS &#40;<code>StableRulesClassifier</code>&#41;</p>\n</li>\n<li><p>LightGBM &#40;<code>LGBMClassifier</code>&#41;</p>\n</li>\n</ul>\n<p>The latter is a state-of-the-art gradient boosting model created by Microsoft. See the Appendix for more details about these results.</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>results = let\n    df = DataFrame(getproperty.([e1, e2, e3, e4, e5, e6], :row))\n    rename!(df, :se =&gt; \"1.96*SE\")\nend</code></pre>\n<table>\n<tr>\n<th></th>\n<th>Model</th>\n<th>Hyperparameters</th>\n<th>AUC</th>\n<th>1.96*SE</th>\n</tr>\n<tr>\n<td>1</td>\n<td>\"DecisionTreeClassifier\"</td>\n<td>\"(max_depth = 2,)\"</td>\n<td>0.64</td>\n<td>0.07</td>\n</tr>\n<tr>\n<td>2</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_rules = 5,)\"</td>\n<td>0.69</td>\n<td>0.08</td>\n</tr>\n<tr>\n<td>3</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_rules = 25,)\"</td>\n<td>0.66</td>\n<td>0.08</td>\n</tr>\n<tr>\n<td>4</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_depth = 1,)\"</td>\n<td>0.69</td>\n<td>0.07</td>\n</tr>\n<tr>\n<td>5</td>\n<td>\"StableForestClassifier\"</td>\n<td>\"(max_depth = 2,)\"</td>\n<td>0.7</td>\n<td>0.07</td>\n</tr>\n<tr>\n<td>6</td>\n<td>\"LGBMClassifier\"</td>\n<td>\"(;)\"</td>\n<td>0.71</td>\n<td>0.06</td>\n</tr>\n</table>\n\n\n\n<div class=\"markdown\"><p>We can summarize these results as follows:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>As can be seen, the score of the stabilized random forest &#40;<code>StableForestClassifier</code>&#41; is almost as good as Microsoft&#39;s classifier &#40;<code>LGBMClassifier</code>&#41;, but both are not interpretable since that requires interpreting thousands of trees. With the rule-based classifier &#40;<code>StableRulesClassifier</code>&#41;, a small amount of predictive performance can be traded for high interpretability. Note that the rule-based classifier may actually be more accurate in practice because verifying and debugging the model is much easier.</p>\n<p>Regarding the hyperparameters, tuning <code>max_rules</code> and <code>max_depth</code> has the most effect. <code>max_rules</code> specifies the number of rules to which the random forest is simplified. Setting to a high number such as 999 makes the predictive performance similar to that of a random forest, but also makes the interpretability as bad as a random forest. Therefore, it makes more sense to truncate the rules to somewhere in the range 5 to 40 to obtain accurate models with high interpretability. <code>max_depth</code> specifies how many levels the trees have. For larger datasets, <code>max_depth&#61;2</code> makes the most sense since it can find more complex patterns in the data. For smaller datasets, <code>max_depth&#61;1</code> makes more sense since it reduces the chance of overfitting. It also simplifies the rules because with <code>max_depth&#61;1</code>, the rule will contain only one conditional &#40;for example, &quot;if A then ...&quot;&#41; versus two conditionals &#40;for example, &quot;if A &amp; B then ...&quot;&#41;. In some cases, model accuracy can be improved by increasing <code>n_trees</code>. The higher this number, the more trees are fitted and, hence, the higher the chance that the right rules are extracted from the trees.</p>\n</div>\n\n","category":"page"},{"location":"#Interpretation","page":"StableTrees","title":"Interpretation","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Finally, let&#39;s interpret the rules that the model has learned. Since we know that the model performs well on the cross-validations, we can fit our preferred model on the complete dataset:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier(; max_depth=1, rng=_rng())\n    mach = machine(model, X, y)\n    fit!(mach)\n    mach.fitresult\nend</code></pre>\n<pre id='var-hash173674' class='code-output documenter-example-output'>StableRules model with 3 rules:\n 0.583 * StableTrees.Rule(TreePath(\" X[i, :nodes] < 2.0 \"), [0.181, 0.819], [0.338, 0.662]) +\n 0.214 * StableTrees.Rule(TreePath(\" X[i, :year] < 1960.0 \"), [0.381, 0.619], [0.281, 0.719]) +\n 0.204 * StableTrees.Rule(TreePath(\" X[i, :age] < 42.0 \"), [0.186, 0.814], [0.272, 0.728])\nand 2 classes: [0.0, 1.0]\n</pre>\n\n\n<div class=\"markdown\"><p>The interpretation of the fitted model is as follows. The model has learned three rules for this dataset. For making a prediction for some value at row <code>i</code>, the model will first look at the value for the <code>nodes</code> feature. If that value is below 2.0, then the probability of survival is 0.819 and the probability of not surviving is 1 - 0.819 &#61; 0.181. To see that the 0.819 means survival, see the bottom of the result which states showing only the probability for class 1.0. The value 0.662 is used when the <code>nodes</code> value is greater or equal to 2.0. Similarly, the model will obtain the probabilities for rules 2 and 3. To obtain the final result, the model will take a weighted average over the three rules.</p>\n<p>Intuitively, the 2 of the rules inside the model makes sense. A patient is more likely to survive if the <code>age</code> of the patient and the number of <code>nodes</code> found inside the patient are lower. Why patients operated before the <code>year</code> 1960 are more likely to survive is unclear to me. This could be an indication that the model is wrong or that there is something unexpected going on. We investigate this perculiarity by visualizing the model.</p>\n</div>\n\n","category":"page"},{"location":"#Visualization","page":"StableTrees","title":"Visualization","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Since our rules are relatively simple with only a binary outcome and only one clause in each rule, the following figure is a way to visualize the obtained rules per fold. For multiple clauses, I would not know how to visualize the rules. What this visualization shows is a blue point for each rule in each fitted model. The horizontal position of each point is determined by the cutpoint specified by the rule and the vertical position is determined by the weight of the rule times the probability of survival &#40;class 1&#41;. So, a higher point means that some rule had a stronger influence on the outcome.</p>\n<p>In the background, a histogram of the data is shown. The histogram is scaled to the highest arrow in all features meaning that each y-axis in this plot has the same height.</p>\n<p>Also, the dashed vertical lines show the empirical quantiles, that is, the possible points at which the model is allowed to split. These empirical quantile are calculated on the full dataset and hence some points fall next to the quantile because the quantile for that fold turned out slightly different.</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>What this plot shows is that the <code>nodes</code> feature is on average chosen as the feature with the most predictive power. This can be concluded from the fact that the arrows are located higher than the arrows for the other features. Furthermore, there is unfortunately some unstability in the position of the splitpoint for the <code>nodes</code> feature. Some models split the data at around 3 and others at around 8. Depending on the context in which this model is used, it might thus be beneficial to decrease the number of empirical quantiles <code>q</code> that the model can use to split on. By default <code>q&#61;10</code>, but maybe something like <code>q&#61;3</code> would make more sense here.</p>\n<p>For the other features, we can see that <code>age</code> is second best in predictive power and <code>year</code> the third best, that is, <code>year</code> actually performs pretty bad. Based on the fact that <code>year</code> is very unstable, it might be better to remove the feature altogether. This visualization might be a solution to the problem posed in the previous section. Apparently, the model felt that it had to fit on <code>year</code> even though the feature has little predictive power. Indeed, removing the feature from the dataset appears to have almost no effect on the accuracy:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>Base.Text(string(\"Full dataset AUC: \", _score(e4.e)))</code></pre>\n<pre id='var-hash883963' class='code-output documenter-example-output'>Full dataset AUC: 0.69</pre>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    e = _evaluate(model, hyperparameters, X[:, Not(:year)], y).e\n    Base.Text(string(\"Without `year` AUC: \", _score(e)))\nend</code></pre>\n<pre id='var-hash642468' class='code-output documenter-example-output'>Without `year` AUC: 0.69</pre>\n\n\n<div class=\"markdown\"><p>For comparison removing the <code>nodes</code> feature does reduce the predictive performance:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    e = _evaluate(model, hyperparameters, X[:, Not(:nodes)], y).e\n    Base.Text(string(\"Without `nodes` AUC: \", _score(e)))\nend</code></pre>\n<pre id='var-hash780419' class='code-output documenter-example-output'>Without `nodes` AUC: 0.59</pre>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n","category":"page"},{"location":"#Acknowledgements","page":"StableTrees","title":"Acknowledgements","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Thanks to ClÃ©ment BÃ©nard, GÃ©rard Biau, SÃ©bastian da Veiga and Erwan Scornet for creating the SIRUS algorithm and documenting it extensively. Special thanks to ClÃ©ment BÃ©nard for answering my questions regarding the implementation. Also thanks to my PhD supervisors Ruud den Hartigh, Peter de Jonge and Frank Blaauw, and Age de Wit and colleagues at the Dutch Ministry of Defence for providing the data clarifying the constraints of the problem and for providing many methodological suggestions.</p>\n</div>\n\n","category":"page"},{"location":"#Appendix","page":"StableTrees","title":"Appendix","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n</div>\n\n<pre class='language-julia'><code class='language-julia'>function _plot_cutpoints(data::AbstractVector)\n    fig = Figure(; resolution=(800, 100))\n    ax = Axis(fig[1, 1])\n    cutpoints = Float64.(unique(ST._cutpoints(data, 10)))\n    scatter!(ax, data, fill(1, length(data)))\n    vlines!(ax, cutpoints; color=:black, linestyle=:dash)\n    textlocs = [(c, 1.1) for c in cutpoints]\n    for cutpoint in cutpoints\n        annotation = string(round(cutpoint; digits=2))::String\n        text!(ax, cutpoint + 0.2, 1.08; text=annotation, textsize=13)\n    end\n    ylims!(ax, 0.9, 1.2)\n    hideydecorations!(ax)\n    return fig\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>begin\n    ENV[\"DATADEPS_ALWAYS_ACCEPT\"] = \"true\"\n\n    using CairoMakie\n    using CategoricalArrays: categorical\n    using CSV: CSV\n    using DataDeps: DataDeps, DataDep, @datadep_str\n    using DataFrames: DataFrame, Not, dropmissing!, filter!, nrow, rename!, select!\n    using LightGBM.MLJInterface: LGBMClassifier\n    using MLJDecisionTreeInterface: DecisionTree, DecisionTreeClassifier\n    using MLJ: CV, MLJ, Not, PerformanceEvaluation, auc, fit!, evaluate, machine\n    using StableRNGs: StableRNG\n    using StableTrees: StableTrees, StableRules, StableForestClassifier, StableRulesClassifier\n    using Statistics: mean\nend</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_rng(seed::Int=1) = StableRNG(seed);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _io2text(f::Function)\n    io = IOBuffer()\n    f(io)\n    s = String(take!(io))\n    return Base.Text(s)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _evaluate(model, X, y; nfolds=10)\n    resampling = CV(; nfolds, shuffle=true, rng=_rng())\n    acceleration = MLJ.CPUThreads()\n    evaluate(model, X, y; acceleration, verbosity=0, resampling, measure=auc)\nend;</code></pre>\n\n\n\n\n\n<pre class='language-julia'><code class='language-julia'>function register_haberman()\n    name = \"Haberman\"\n    message = \"Slightly modified copy of Haberman's Survival Data Set\"\n    remote_path = \"https://github.com/rikhuijzer/haberman-survival-dataset/releases/download/v1.0.0/haberman.csv\"\n    checksum = \"a7e9aeb249e11ac17c2b8ea4fdafd5c9392219d27cb819ffaeb8a869eb727a0f\"\n    DataDeps.register(DataDep(name, message, remote_path, checksum))\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _haberman()\n    register_haberman()\n    dir = datadep\"Haberman\"\n    path = joinpath(dir, \"haberman.csv\")\n    df = CSV.read(path, DataFrame)\n    df[!, :survival] = categorical(df.survival)\n    # Need Floats for the LGBMClassifier.\n    for col in [:age, :year, :nodes]\n        df[!, col] = float.(df[:, col])\n    end\n    return df\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_filter_rng(hyper::NamedTuple) = Base.structdiff(hyper, (; rng=:foo));</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_pretty_name(modeltype) = last(split(string(modeltype), '.'));</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _evaluate(modeltype, hyperparameters, X, y)\n    model = modeltype(; hyperparameters...)\n    e = _evaluate(model, X, y)\n    row = (;\n        Model=_pretty_name(modeltype),\n        Hyperparameters=_hyper2str(_filter_rng(hyperparameters)),\n        AUC=_score(e),\n        se=round(only(MLJ.MLJBase._standard_errors(e)); digits=2)\n    )\n    (; e, row)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_hyper2str(hyper::NamedTuple) = hyper == (;) ? \"(;)\" : string(hyper)::String;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _score(e::PerformanceEvaluation)\n    return round(only(e.measurement); digits=2)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e1 = let\n    model = DecisionTreeClassifier\n    hyperparameters = (; max_depth=2, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e2 = let\n    model = StableRulesClassifier\n    hyperparameters = (; max_rules=5, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e3 = let\n    model = StableRulesClassifier\n    hyperparameters = (;  max_rules=25, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e4 = let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e5 = let\n    model = StableForestClassifier\n    hyperparameters = (; max_depth=2, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e6 = let\n    model = LGBMClassifier\n    hyperparameters = (; )\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"","page":"StableTrees","title":"StableTrees","text":"EditURL = \"https://github.com/rikhuijzer/StableTrees.jl/blob/main/docs/src/stabletrees.jl\"","category":"page"}]
}
